claves. The town of Baarle which is in the Netherlands and Belgium is an incredibly complicated border. But not quite as much as the Cooch Behar region of India and Bangladesh. \\n\\nThis is followed by a look at the odd situation of Bir Tawil, the only unclaimed land on Earth outside of Antarctica (which is itself a place for complex borders!)\\n\\nI finish off the video by looking at the island of Cyprus, which may look like a borderless island, but is in fact far from it!\\n\\n**COPYRIGHT INFORMATION**\\n\\n\\n*IMAGES*\\n\\nAll images used are: public domain; licensed under Creative Commons with attribution; or used with permission. \\n\\nVatican City (by David Illif) - http:\/\/goo.gl\/ppjkcW\\n\\nCar parked on International border (Tarun Chandel) - http:\/\/photos.tarunchandel.com\/\\n\\nBaarle images (Stephen Eustace) - http:\/\/www.flickr.com\/photos\/seustace2003\\n\\n*MUSIC* \\n\\nBackground music is royalty free and licensed under Creative Commons: By Attribution 3.0\\n\\nFive Card Shuffle \\nKevin MacLeod\\nhttp:\/\/www.incompetech.com\\n\\nhttp:\/\/creativecommons.org\/licenses\/by\/3.0\/\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/gtLxZiiuaXs\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCWU7S1cwB_VBkUAqrTJ-H0zx70tQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/gtLxZiiuaXs\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLA8cpvW9kQoQMVmB6sNifCGh3r94w\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/gtLxZiiuaXs\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCIxDGMlJL21pVJil9OdckKwvfW-g\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/gtLxZiiuaXs\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBPIAfpcjHDL8UB4iBRrUUJ0tUBFQ\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/ more complex borders in the world, but this video looks at some of my favourites. \n\nI look at the 3 enclaves countries of the world: Vatican City, San Marino and Lesotho. As well as Campione d'Italia, an Italian exclave which is an enclave of Switzerland. \n\nI then take things up a notch and look at enclaves within enclaves. The town of Baarle which is in the Netherlands and Belgium is an incredibly complicated border. But not quite as much as the Cooch Behar region of India and Bangladesh. \n\nThis is followed by a look at the odd situation of Bir Tawil, the only unclaimed land on Earth outside of Antarctica (which is itself a place for complex borders!)\n\nI finish off the video by looking at the island of Cyprus, which may look like a borderless island, but is in fact far from it!\n\n**COPYRIGHT INFORMATION**\n\n\n*IMAGES*\n\nAll images used are: public domain; licensed under Creative Commons with attribution; or used with permission. \n\nVatican City (by David Illif) - "},{"text":"http://goo.gl/ppjkcW","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIhsDyseac6gIVBt8WCh2ZigG7SPvSucXirLzpggE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=gtLxZiiuaXs\u0026redir_token=KG1xKbv2TVd02SG8djmwMGYk-Kh8MTU5MzE2ODc5NEAxNTkzMDgyMzk0\u0026event=video_description\u0026q=http%3A%2F%2Fgoo.gl%2FppjkcW","rootVe":83769}},"urlEndpoint":{"url":"/redirect?v=gtLxZiiuaXs\u0026redir_token=KG1xKbv2TVd02SG8djmwMGYk-Kh8MTU5MzE2ODc5NEAxNTkzMDgyMzk0\u0026event=video_description\u0026q=http%3A%2F%2Fgoo.gl%2FppjkcW","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nCar parked on International border (Tarun Chandel) - "},{"text":"http://photos.tarunchandel.com/","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIhsDyseac6gIVBt8WCh2ZigG7SPvSucXirLzpggE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?v=gtLxZiiuaXs\u0026redir_token=KG1xKbv2TVd02SG8djmwMGYk-Kh8MTU5MzE2ODc5NEAxNTkzMDgyMzk0\u0026event=video_description\u0026q=http%3A%2F%2F
